import React from "react";
import Navigator from "../Navigator";
import DeleteIcon from '@material-ui/icons/Delete';
import style from '../../assets/css/App.styles'
import Filtros from "../Filtros";
import { Grid, Button, Fab } from "@material-ui/core";

import AddIcon from '@material-ui/icons/Navigation';
const Menu: React.FC<{}> = () => {
  const classes = style();
  return (
    <Grid container spacing={3}>
      <Grid item xs={4}>
      <Fab
          variant="extended"
          size="medium"
          color="primary"
          aria-label="add"

        >
          <AddIcon  />
          Add
        </Fab>

        <Navigator></Navigator>
      </Grid>
      <Grid item xs={8}>
        <Filtros></Filtros>
      </Grid>
    </Grid>
  );


}

export default Menu;
